const Home = () => {

  let [blogs, setBlogs] = useState([
    { content: "Hello world!", id: 1 },
    { content: "My name is ACF", id: 2}
  ]);

  return (
    <div className="home">
      <h2>Homepage</h2>
    </div>
  );
}

export default Home;
